window.bookSummaryJSON = "<p>Corporate flameout Ned Altimer dreams of leaving his world behind. So, when<i> Earthblood Online</i> splashes onto the VRMMO scene, he dives in and never looks back.</p> <p>His advantages are twofold: exclusive access to the game’s three-day Head Start period, and a ridiculously handsome talking axe named Frank who has knowledge of the game’s deepest secrets...if the magnificent Frank ever feels like sharing them.</p> <p>But those advantages also make Ned a target. Once the Head Start period ends, his fellow players will stop at nothing to rip that suave, violent, yet disarmingly charismatic axe right out of his hands.</p> <p>In 72 hours, the greatest manhunt in gaming history is set to begin.</p> <p>It’s gonna be a lot of fun.</p>"; 
